import React from 'react';


const ProfileStatusHooks = () => {

    return (
        <div>
            {
            <div>
                <span
                    onDoubleClick={this.activateEditMode}>{props.status || '-----'}</span>
            </div>
            }
            {false &&
            <div>
                <input onChange={this.onStatusChange} autoFocus={true}
                       onBlur={''}
                       value={''}/>
            </div>
            }
        </div>

    )

}


export default ProfileStatusHooks;
